import React from 'react';
import './Project.css';
import Card from './Card';
import img1 from '../../images/p-1.png';
import img2 from '../../images/p-2.png';
import img3 from '../../images/p-3.png';
import img4 from '../../images/p-4.png';
export default function Project(){

    const title=["Typing-Test","Random_Quotes","Conference-Page","Basic-Calculator","Notes-App"];

    return(
        <>
          <div className="p">
             <h2 className="p-title"> Recent Projects</h2>
             <div className="p-menu">
                 <div className="h-c-js">
                     HTML|CSS|JS
                 </div>
                 <div className="react">
                     React
                 </div>
                 <div className="node">
                     Node|MdB
                 </div>
              </div>
              <div className="p-p">
                  <Card image={img1} title={title[0]}/>
                  <Card image={img2} title={title[1]}/>
                  <Card image={img3} title={title[2]}/>
              </div>
              <div className="p-rp">
                   <Card image={img4} title={title[3]} />
                   <Card  title={title[4]} />
              </div>
              <div className="p-bp">

              </div>
          </div>
        </>
    )
}
